import React from 'react';
import Navigate from './navigate';
import './nav.css';

const Nav = () => (
  <header className="page-header">
    <nav>
      <Navigate href="/">index</Navigate>
      <Navigate href="/">page-two</Navigate>
      <Navigate href="/">page-three</Navigate>
    </nav>
  </header>
);

export default Nav;
